O imóvel é vendido no estado físico e jurídico em que se encontra e a eventual regularização das áreas ou legalização do imóvel é responsabilidade do adquirente
a) O pedido de marcação para visita terá de ser feito de forma escrita para o email disponível no local reservado para o efeito, mas caso esteja previamente agendado o dia e hora, não serão efetuadas visitas fora desse horário;
b) Não serão agendadas visitas nos últimos 5 dias úteis antes da data do fim do leilão; 
c) Com a apresentação da proposta, presume-se que os interessados tenham inspecionado o imóvel e conhecem as suas características, declinando-se qualquer responsabilidade pelo seu estado de conservação, assim como, qualquer descrição incorreta da informação que possa induzir em erro, devendo ainda o interessado inteirar-se junto das entidades competentes das demais características, licenças e/ou outros aspetos que considerem relevantes. A sua não verificação não é fundamento para anulação da venda. 
d) Advertem-se ainda os potenciais interessados que os bens que se encontram no interior do imóvel não fazem parte do objecto negociável. 
e) Deverão igualmente, ter em consideração que, atendendo às especificidades da venda e ao facto de o bem não ser entregue no momento da conclusão do leilão, o mesmo poderá sofrer deteriorações ou alterações cuja responsabilidade apenas será imputável ao fiel depositário. 
f) Todos os custos inerentes ao registo de aquisição serão suportados pelo adquirente; 
g) A presente venda está dispensada da apresentação do alvará de licença de utilização do prédio, certificado energético e ficha técnica de habitação, pelo que, nos termos das mesmas disposições legais, constitui ónus do adquirente a respetiva legalização dos imóveis, se for caso disso; 
h) Na ausência dos pagamentos nos prazos estipulados, será considerada desistência e consequente denúncia no portal “e-leilões.pt”, assim como serão tomadas as medidas previstas no art.º 825º do Código do Processo Civil
